import React, {Component} from "react";
import {Square} from "./gameComponents/Square";

export class Board extends Component {
  
    render() {
      return (
        <div className="board">
            <Square />
            <Square />
            <Square />
            <Square />
            <Square />
            <Square />
        </div>
      );
    }
  }
